    return(
        <Container>
            <header>
                <h1>Ol√°, Fulano</h1>
                <IoExitOutline size={24} color={'#ffffff'} />
            </header>
            <Content>

            </Content>
        </Container>
    );
}

const Container = styled.div`
    display: flex;
    align-items: center;
    flex-direction: column;
    width: 100%;
    height:915px;
    padding-left: 24px;
    padding-right: 24px;
    padding-top: 24px;
    padding-bottom: 16px;
    background-color: #8C11BE;

